import "./HomePage.css";
import image from "../assets/search.png";
function CornerPiece(props) {
  return <div>{props.value}</div>;
}

const HomePage = () => {
  return (
    <div id="menu-outer">
      <div class="alignleft">
        <img className="bodyImage" src={ig} alt="instagram" />
      </div>
      <div class="alignright">
        <CornerPiece value={<h3>Pocket Watcher</h3>} />
      </div>
    </div>
  );
};

export default HomePage;
